import { io } from "socket.io-client";

class Client {

    connect() {
        const socket = io("http://localhost:3000", {
            transports: ['websocket']
        });

        socket.on("connect", () => {
            console.log(socket.id); // 'G5p5...'
        });

        socket.on("connect_error", (err) => {
            console.log(err); // true
        });
    }

}


export default Client;
